age/20170522/1495433643121013190.png\" title=\"1495433643121013190.png\" alt=\"QQ20170510-1.png\"/></p>', '1', null, '', '0', null, null), ('343', '-1', '92', '医务部组织开展“患者十大安全目标”专题培训', '', '', 'admin', '2017-05-22 15:03:14', '22', '<p><img src=\"http://172.16.5.196:8080/upload/image/20170622/1498111787723039271.jpg\" title=\"1495436570850099018.png\" alt=\"1495436570850099018.png\" width=\"327\" height=\"191\" border=\"0\" vspace=\"0\" style=\"width: 327px; height: 191px;\"/>都是范德萨，都是a</p><p>dv萨拉克服vdskalmvldsalkvds考虑；咖啡豆绿卡了；发大水；啦； 发大水</p>', '1', null, 'http://172.16.5.196:8080/upload/image/20170622/1498111787723039271.jpg', '0', null, null), ('344', '-1', '87', '我院主办的四川省2017年“全民营养周”活动正式启动', '', '指后天与营养代谢有关的周围神经病变，包括营养缺乏性神经病（维生素缺乏性、酒精中毒性、吸收不良营养缺乏性）、糖尿病性周围神经病、尿毒症性周围神经病、肝病性周围神经病、血卟啉病性周围神经病等，其中糖尿病性周围神经病最常见。\n\n', 'admin', '2017-05-23 10:36:04', '49', '<h1 style=\"margin: 0px; padding: 0px; font-size: 1.4rem; line-height: 1.2;\">代谢性周围神经病</h1><p style=\"margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word; text-align: center; margin-top: 0px !important;\"><img src=\"/ueditor/jsp/upload/image/20170523/1495506946778092816.jpg\" title=\"健康问答.jpg\" alt=\"健康问答.jpg\" style=\"border: 0px; max-width: 100%; margin: 0px; vertical-align: middle;\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">1.	代谢性周围神经病是什么病？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">指后天与营养代谢有关的周围神经病变，包括营养缺乏性神经病（维生素缺乏性、酒精中毒性、吸收不良营养缺乏性）、<a href=\"http://dxy.com/faq/4345\" class=\"dxylink\" target=\"_black\" style=\"text-decoration-line: none; color: rgb(124, 104, 180); word-break: break-all;\">糖尿病性周围神经病</a>、尿毒症性周围神经病、肝病性周围神经病、血卟啉病性周围神经病等，其中糖尿病性周围神经病最常见。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">2.	代谢性周围神经病的原因是什么？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">周围神经可受多种因素损伤，最常见的病因有糖尿病和酗酒，此外还可能由尿毒症、营养缺乏引起，产生一系列症状。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">3.	代谢性周围神经病会遗传吗？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">与遗传并无明显关系。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">4.	代谢性周围神经病一般去看哪个科？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">神经内科。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">5.	哪些人群比较容易出现代谢性周围神经病？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">长期糖尿病、酗酒、尿毒症、营养缺乏等情况的人群，容易发生周围神经病变。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">6.	代谢性周围神经病有什么表现？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">常见的症状主要有：</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">1）	感觉障碍，如麻木、疼痛；</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">2）	运动障碍，如无力、瘫痪；</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">3）	自主神经功能障碍，如泌汗障碍、肢体远端营养障碍（表皮粗糙，色素沉着，溃疡）、毛发稀少、指甲变脆或增厚等；</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">4）	其他如共济失调、手足或脊柱的畸形等。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\"><span style=\"font-weight: 700;\">7.	代谢性周围神经病怎么治疗？</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">1）	基础疾病的治疗：比如药物和酒精引起的神经病，应避免饮酒和使用相应药物；糖尿病患者应严格控制血糖；甲减所致的神经病症状可通过甲状腺激素替代治疗来改善；</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(68, 68, 68); word-wrap: break-word;\">2）	对症治疗：可使用加巴喷丁和三环类抗抑郁药来缓解神经痛，此外卡马西平等药物也可能有帮助。</p><p><br/></p>', '1', null, '', '0', null, null), ('345', '-1', '87', '省安监局唐克农处长一行对我院职业病防治工作开展调研', '', 'fdsafdsaf dfsa fdsa fdsa fdsa fdsa ', 'admin', '2017-06-12 14:12:40', '21', '<p><br></p>', '1', null, '', '1', '', null), ('346', '-1', '3', null, null, null, null, null, null, null, null, null, null, null, null, null), ('347', '-1', '88', '2015-2016年度陈志潜奖（助）学金、南山疾控特别奖颁奖', '通知, 单位', '的撒多撒多dsa发生大的撒多撒', 'admin', '2017-06-12 19:27:23', '77', '<p><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\" style=\"white-space: normal;\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0071.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0027.gif\"/>