'', '0', null, null), ('353', '-1', '138', '党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2', '党建知识2', '党建知识2党建知识2党建知识2', 'admin', '2017-06-19 16:53:15', '9', '<p>党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2党建知识2</p>', '1', null, '', '0', null, null), ('354', '-1', '139', '学习教育第三代快乐撒 ', '', '学习教育第三代快乐撒 ', 'admin', '2017-06-19 17:00:13', '2', '<p>学习教育第三代快乐撒&nbsp;学习教育第三代快乐撒&nbsp;学习教育第三代快乐撒&nbsp;学习教育第三代快乐撒&nbsp;学习教育第三代快乐撒&nbsp;学习教育第三代快乐撒&nbsp;学习教育第三代快乐撒&nbsp;<img src=\"http://img.baidu.com/hi/jx2/j_0059.gif\"/></p>', '1', '', '', '0', null, null), ('355', '82', '107', 'fdsafdsafsad 啥哈哈哈哈哈啊哈的撒', '', '大师法反倒是爱国', 'admin', '2017-06-20 17:42:59', '7', '<p>dfasfdsafsadfdsafdsafdsfdsaf</p><p><br/></p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"http://172.16.5.196:8080/public/ueditor/dialogs/attachment/fileTypeImages/icon_doc.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/file/20170621/1498011359734028788.docx\" title=\"11.docx\">11.docx</a></p><p><br/></p>', '1', null, 'http://172.16.5.196:8080/upload/image/20170620/1497951756708071783.jpeg', '0', null, null), ('356', '57', '144', '急诊科办事规范说明', '', '发多少范德萨范德萨发范德萨', 'marker', '2017-06-21 13:54:08', '52', '<h3 id=\"-\">大可能打死你理发店</h3> \n<p>范德萨范德萨范德萨范德萨发大 发送范德萨范德萨发大</p> \n<h3 id=\"-\">的撒旦卡拉斯科打开门萨面对</h3> \n<p>发大水发的反倒是</p> \n<h3 id=\"-\">大大大</h3>', '1', '', '', '1', '### 大可能打死你理发店\n\n\n范德萨范德萨范德萨范德萨发大\n发送范德萨范德萨发大\n\n\n### 的撒旦卡拉斯科打开门萨面对\n\n\n发大水发的反倒是\n\n\n\n### 大大大', null), ('357', '57', '144', '办事流程二', '', '', 'marker', '2017-06-21 14:42:30', '10', '<p><embed id=\"xunlei_com_thunder_helper_plugin_d462f475-c18e-46be-bd10-327458d045bd\" type=\"application/thunder_download_plugin\" height=\"0\" width=\"0\"/></p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"http://172.16.5.196:8080/public/ueditor/dialogs/attachment/fileTypeImages/icon_rar.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/file/20170621/1498038057913030852.zip\" title=\"20170619周刊.zip\">20170619周刊.zip</a></p><p><br/></p>', '1', null, '', '0', null, null), ('358', '-1', '113', '特色专科3432423买空卖空林妙可林妙可', '', '的萨达四大', 'admin', '2017-06-21 17:44:53', '3', '<p>dsadsad</p>', '1', null, '', '0', null, null), ('359', '-1', '87', '纪念我国著名公共卫生学家陈志潜先生', '', '', 'admin', '2017-06-21 17:50:21', '11', '<p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: ����; font-size: 12px; white-space: normal;\"><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\">在中国历史上，很少有人在医学领域能比这位伟人更加受人尊重和纪念。他对于农村地区人群健康的关注，是其长期而杰出事业中的突出成就。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: ����; font-size: 12px; white-space: normal;\"><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\">&nbsp;&nbsp;&nbsp;&nbsp; 自古以来，农村地区人群的健康保健问题是政府的卫生官员们所需要面对的最为棘手的问题。这是个复杂的挑战，它涉及包括经济资源、劳动力、继续教育、文化、农村人口的教育水平、医疗／保健的地区选择以及人类本性等到多个方面的问题。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: ����; font-size: 12px; white-space: normal;\"><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\">&nbsp;&nbsp;&nbsp;&nbsp; 自1929年陈教授从北京协和医学院毕业以来，他就将自己的创造力投入到寻找解决处于困境中的中国农村保健问题的办法之中。他提出了一个大胆而崭新的概念-“初级卫生保健”，并建议以此为基础建立农村卫生组织。目前，这一概念已被全世界所接受，这比世界卫生组织提出以“初级卫生保健”为基础，向全人类提供卫生保健服务的提议早了40年。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: ����; font-size: 12px; white-space: normal;\"><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\">&nbsp;&nbsp;&nbsp;&nbsp; 他提出的“初级卫生保健”在很大程度上等同于 “社区医疗”这一概念，后者目前被世界公认并作为衡量人群健康是否得以保护的准则。正是由于这些贡献，他被当之无愧地誉为“中国公共卫生之父”。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: ����; font-size: 12px; white-space: normal;\"><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\">&nbsp;&nbsp;&nbsp;&nbsp; 在对中国和世界的卫生需求进行考察时，我深感我们需要陈志潜教授似的人物。特别是需要他那种献身于农村人群健康的精神，定义农村保健新体系的创造性天赋，以及激发他人与自己一同实现远景目标的超凡能力。是否有一位陈教授似的领军人物从成都这片沃土上成长起来了？今天，如果能有这样的人物，我们需要怎样做，以确保这样的个人有足够发展机会以及运用其独特才能？这些问题既是每位教育者的机遇，也是责任。陈志潜教授式的角色给予我们应对这一挑战的希望。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: ����; font-size: 12px; white-space: normal;\"><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\">&nbsp;&nbsp;&nbsp; 中华医学基金会向这样一位伟人致敬，也希望在成都能出现又一位这样的人物。</span></p><p><span style=\"font-family: 微软雅黑, \" microsoft=\"\" font-size:=\"\"><span class=\"style10\" style=\"font-size: 14px; font-family: 微软雅黑, \" microsoft=\"\" padding:=\"\" margin:=\"\">M. Roy Schwarz , M.D</span>—中华医学基金会主席.<br style=\"padding: 0px; margin: 0px;\"/><br style=\"padding: 0px; margin: 0px;\"/>2004年4月15日</span></p><p><br/></p>', '1', null, 'http://172.16.5.196:8080/upload/image/20170622/1498110172464012031.jpg', '0', null, null), ('360', '-1', '87', '我院组织召开举行党组织和党员基本信息采集工作培训会', '', '', 'admin', '2017-06-22 10:24:00', '1', null, '1', '', '', '0', null, null), ('361', '-1', '87', '我院组织召开举行党组织和党员基本信息采集工作培训会', '', '', 'admin', '2017-06-22 10:24:15', '2', '', '1', null, '', '0', null, null), ('368', '-1', '87', '我院通报院领导班子“两学一做”民主生活会情况', '', '', 'admin', '2017-06-22 13:45:38', '21', '<p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 18px;text-indent: 37px\"><span style=\"padding: 0px;line-height: 28px;font-family: 宋体;font-size: 19px\">根据中央和《中共四川大学委员会关于认真开好<span style=\"padding: 0px\">2016</span>年度处级以上党员领导人员民主生活会的通知》的相关要求<span style=\"padding: 0px\">,</span>我院于<span style=\"padding: 0px\">2017</span>年<span style=\"padding: 0px\">1</span>月<span style=\"padding: 0px\">17</span>日下午在华西卫生管理干部培训中心学术报告厅召开了院领导班子“两学一做”民主生活会情况通报会。院党政领导班子全体成员、院长助理、学系主任、职能部门负责人、临床科室主任和护士长、党支部书记、工会小组长、全体教师、党员代表、校（院）两级“双代会”代表、民主党派代表、离退休教职工代表参加了会议。</span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 18px;text-indent: 37px\"><span style=\"padding: 0px;line-height: 28px;font-family: 宋体;font-size: 19px\">会上，曾诚书记报告了院领导班子<span style=\"padding: 0px\">2016</span>年度<span style=\"padding: 0px\">“</span>两学一做<span style=\"padding: 0px\">”</span>民主生活会前期准备工作，包括面向全院征集意见和建议、院领导班子成员撰写个人批评与自我批评发言提纲等情况，并就我院召开院班子和院领导“两学一做”民主生活会的会议程序、开展自我批评与批评的情况、四川大学纪委监察处负责同志对民主生活会的整体评价以及下一步整改落实的思路与举措四个方面向大家作了详细通报。曾诚书记重点谈到通过民主生活会查找出的我院领导班子在理想信念、政治纪律和政治规矩、个人作风、担当作为、组织生活会、落实全面从严治党责任六方面存在的问题，并表示接下来将对症下药，从政治合格、执行纪律合格、品德合格、发挥作用合格四个方面整改落实，力求以党建带动学院和医院各项工作发展。参会人员在认真听取通报内容后一致认为，院领导班子召开“两学一做”民主生活会查找问题到位，同时对全院工作的后续发展有更加清晰的认识和举措。</span></p><p><br/></p>', '1', null, 'http://172.16.5.196:8080/upload/image/20170622/1498110323604073102.jpg', '0', null, '2017-06-23 15:39:29'), ('364', '-1', '88', '我院拟邀请招标活检针、透析导管耗材', '透析, 检针, 我院, 导管, 耗材', '', 'admin', '2017-06-22 10:37:20', '13', '<p style=\"padding: 0px;margin: 0 9px 0 0;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;text-indent: 59px;line-height: 22px\"><span style=\"padding: 0px;letter-spacing: 3px;font-size: 19px\">本院近期拟通过院内招标确定“活检针、透析导管<span style=\"padding: 0px\">”</span>一系列耗材的供应商。请有投标意向的投标人带上公司及厂家有效期内资质资料<span style=\"padding: 0px\">(</span>营业执照副本、组织机构代码证、国<span style=\"padding: 0px\">/</span>地税税务登记证，如已办理<span style=\"padding: 0px\">3</span>证合<span style=\"padding: 0px\">1</span>则只需提供营业执照复印件，医疗器械经营企业许可证、医疗器械生产企业许可证、医疗器械注册证、厂家授权书、法人授权书、投标人身份证等资质文件复印件）需盖鲜章，尽快与我院设备科联系。</span></p><p style=\"padding: 0px;margin: 0 9px 0 0;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 22px\"><span style=\"padding: 0px;letter-spacing: 3px;font-size: 19px\">&nbsp;</span></p><p style=\"padding: 0px;margin: 0 9px 0 0;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 22px\"><span style=\"padding: 0px;letter-spacing: 3px;font-size: 19px\">&nbsp;&nbsp;</span><span style=\"padding: 0px;letter-spacing: 3px;font-size: 19px\">有效期：<span style=\"padding: 0px\">7</span>天</span></p><p style=\"padding: 0px;margin: 0 9px 0 0;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 22px\"><span style=\"padding: 0px;letter-spacing: 3px;font-size: 19px\">&nbsp;&nbsp;</span><span style=\"padding: 0px;letter-spacing: 3px;font-size: 19px\">联系电话：<span style=\"padding: 0px\">85501579</span></span></p><p><br/></p>', '1', '', '', '0', null, null), ('365', '-1', '110', '环境卫生与职业医学系', '', '', 'admin', '2017-06-22 11:47:05', '10', '<p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;text-align: center\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">环境与职业医学系情况简介</span></span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 15px;text-indent: 28px\"><strong style=\"padding: 0px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">一、发展沿革</span></span></strong></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">环境与职业医学系于</span><span style=\"padding: 0px;font-size: 12px\">2013</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年底成立，由原环境卫生教研室、劳动卫生教研室和病理教研室合并而成。原环境卫生教研室始建于</span><span style=\"padding: 0px;font-size: 12px\">1955</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年，是国内成立最早的环境卫生学教研室之一。五十多年来，教研室不断壮大，在教学和科研中均取得了显著的成绩，在西南同行中首屈一指，在全国同行中享有较高的地位。</span><span style=\"padding: 0px;font-size: 12px\">1980</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年和</span><span style=\"padding: 0px;font-size: 12px\">1986</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年先后被国家批准为硕士学位和博士学位授权点，导师分别为本专业全国著名的过基同教授和孙棉龄教授。</span><span style=\"padding: 0px;font-size: 12px\">1998</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年与劳动卫生教研室合并建立了“劳动卫生与环境卫生学”学科，并被列为四川省重点学科之一，</span><span style=\"padding: 0px;font-size: 12px\">1999</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年被批准为博士后流动站。历任教研室主任为过基同、孙棉龄、杨在昌、吴德生、衡正昌、谭宗庆和张遵真。原劳动卫生与职业病学教研室历史悠久，始建立于</span><span style=\"padding: 0px;font-size: 12px\">1956</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年</span><span style=\"padding: 0px;font-size: 12px\">1</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">月，为该学科在全国最早建立的教研室之一，</span><span style=\"padding: 0px;font-size: 12px\">1981</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">成为国务院批准的第一批硕士点，</span><span style=\"padding: 0px;font-size: 12px\">1984</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年成为国务院批准的第二批博士点。原病理教研室是全国所有公共卫生学院唯一的病理教研室，是应研究地方病、职业病的需要，于</span><span style=\"padding: 0px;font-size: 12px\">1978</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年</span><span style=\"padding: 0px;font-size: 12px\">2</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">月组建的。第一任主任郑志仁教授，是环境病理学科带头人，曾先后担任中华预防医学会直属环境病理学组组长，四川省环境病理学会主任委员；教研室第二任主任李洪洋教授，第三任主任张银柱教授曾担任中华预防医学会环境病理专委会副主任委员，四川省环境病理学会主任委员；第四任主任程薇波副教授，担任中华预防医学会职业与环境病理学组副主任委员，四川省环境诱变剂学会理事会理事。教研室的老教授郑志仁、李洪洋、张银柱、吴忠舜等在毒性病理学的病理诊断方面具有很深的造诣，在全国位列前茅。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 15px;text-indent: 28px\"><strong style=\"padding: 0px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">二、师资队伍情况</span></span></strong></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">本系现任系主任为兰亚佳，副主任为张遵真，现有在岗教授</span><span style=\"padding: 0px;font-size: 12px\">5</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人、副教授</span><span style=\"padding: 0px;font-size: 12px\">6</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人、讲师</span><span style=\"padding: 0px;font-size: 12px\">4</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人，实验技师</span><span style=\"padding: 0px;font-size: 12px\">3</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人，包括博士导师</span><span style=\"padding: 0px;font-size: 12px\">2</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人、硕士导师</span><span style=\"padding: 0px;font-size: 12px\">5</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人。其中获博士学位</span><span style=\"padding: 0px;font-size: 12px\">11</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人、硕士及以下学位</span><span style=\"padding: 0px;font-size: 12px\">4</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">兰亚佳，男，生于</span><span style=\"padding: 0px;font-size: 12px\">1961</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年，教授，博士生导师，现任卫生部国家突发公共卫生事件专家组委员、卫生部传染病标准专业委员会委员、中华预防医学会劳动卫生职业病分会委员、中华预防医学会劳动卫生职业病分会职业性肺部疾病学组委员、四川省卫生厅学术带头人、成都市预防医学会职业卫生分会主任委员、四川省地方病专家咨询委员会副主任委员。近</span><span style=\"padding: 0px;font-size: 12px\">5</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年承担各类科研课题</span><span style=\"padding: 0px;font-size: 12px\">15</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">余项，发表论文</span><span style=\"padding: 0px;font-size: 12px\">73</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">篇，主</span><span style=\"padding: 0px;font-size: 12px\">/</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">参编专著</span><span style=\"padding: 0px;font-size: 12px\">3</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">本。目前主持的主要在研课题有“症状监测预警技术研究”、“传染病暴发早期探测与自动预警适宜技术研究”、“流脑、出血热、麻疹预警技术标准”等。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\">&nbsp;</p><p style=\"padding: 0px;margin-top: 0px;margin-right: 56px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 18px;text-indent: 28px\"><span style=\"padding: 0px;font-size: larger\"><span style=\"padding: 0px;line-height: 21.6px\">张遵真，女，医学博士，教授，博士生导师。主要研究方向为环境污染物对人体健康的影响，主要涉及分子遗传毒理学、生物标志，<span style=\"padding: 0px\">DNA</span>损伤与修复等研究内容。现任四川大学华西公共卫生学院环境卫生教研室主任，卫生部环境与健康专家委员会委员，四川省环境科学会理事，中华预防医学会四川省第四届环境卫生专业委会主任委员。曾获中国环境科学学会<span style=\"padding: 0px\">“</span>优秀环境科学工作者<span style=\"padding: 0px\">”</span>称号，并多次获得四川大学颁发的<span style=\"padding: 0px\">“</span>优秀实习指导教师<span style=\"padding: 0px\">”</span>嘉奖。作为青年骨干教师，于<span style=\"padding: 0px\">2006</span>年受国家留学基金的资助在美国国立环境卫生科学研究院（<span style=\"padding: 0px\">NIEHS</span>）访问学习一年，<span style=\"padding: 0px\">2011</span>年被美国<span style=\"padding: 0px\">Florida International University</span>（<span style=\"padding: 0px\">FIU</span>）聘请为客座教授。多年来一直工作在教学、科研第一线，参与了大量的预防医学本科学生《环境卫生学》专业课的课堂讲授、毕业实习指导和课间实习的教学，并为全校本科生开设了《室内空气污染与健康的文化素质选修课；近年来为适应教学改革的需求，张遵真教授又为预防医学学生新开设了《居室与健康》的选修课。张遵真教授高度重视研究生能力的全面培养，对研究生科研思维、实验技巧和科学写作等科研能力的培养具有丰富的经验，并取得了突出的成效，现已培养和指导了<span style=\"padding: 0px\">20</span>多位博士研究生和硕士研究生。自<span style=\"padding: 0px\">2000</span>年以来，张遵真教授先后主持了<span style=\"padding: 0px\">3</span>项国家自然科学基金课题：<span style=\"padding: 0px\">“HOGG1</span>低表达细胞株的建立及其在<span style=\"padding: 0px\">DNA</span>氧化损伤与肺癌相关性中的研究<span style=\"padding: 0px\">”&nbsp;</span>，<span style=\"padding: 0px\">“DNA</span>聚合酶<span style=\"padding: 0px\">β</span>表达水平的改变在环境污染物遗传毒性中的作用<span style=\"padding: 0px\">”</span>和<span style=\"padding: 0px\">“Nrf2-AREs</span>和<span style=\"padding: 0px\">NF-κB</span>信号通路及其交互作用在低水平砷诱导细胞凋亡中的作用<span style=\"padding: 0px\">”</span>，在国内外核心期刊发表科研论文<span style=\"padding: 0px\">100</span>余篇，其中绝大多数为<span style=\"padding: 0px\">Medline</span>收录，<span style=\"padding: 0px\">8</span>篇为<span style=\"padding: 0px\">SCI</span>收录。除了科研和教学，张遵真教授积极参加各种社会活动，为很多期刊杂志评审文章，为学会进行学术讲座，同时参与保健食品、化妆品、消毒剂、农药等的安全性评价及保健食品功能学评价研究。</span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-right: 56px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 18px;text-indent: 28px\">&nbsp;</p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-size: 16px\">&nbsp;</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">赵立强，男，生于</span><span style=\"padding: 0px;font-size: 12px\">1971</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年，教授，硕士生导师，主任医师，四川大学华西第四医院书记兼四川大学公共卫生学院</span><span style=\"padding: 0px;font-size: 12px\">/</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">四川大学华西第四医院副院长。担任《中国工业医学杂志》第四届、《中国职业医学》第八届编委。兼任中国医师协会健康保险委员会委员，四川省预防医学会劳动卫生与职业病专委会常委、秘书，成都市预防医学会职业卫生专委会副主任委员。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">杨跃林，男，生于</span><span style=\"padding: 0px;font-size: 12px\">1961</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年，教授，硕士生导师，主任医师，四川大学公共卫生学院</span><span style=\"padding: 0px;font-size: 12px\">/</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">四川大学华西第四医院副院长。全国预防医学会职业病专委会委员</span><span style=\"padding: 0px;font-size: 12px\">;</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">四川省预防医学会劳动卫生与职业病专委会主任委员；中华预防医学会职业病专业委员会第三届委员会委员；四川省医学会理事；四川省医学会老年病学学专委会副主任委员，姑息医学学组组长；《现代预防医学》副主编；四川省职业安全健康协会副理事长等。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">张晓晴，女，生于</span><span style=\"padding: 0px;font-size: 12px\">1964</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年，教授，硕士生导师，主任医师。主要研究方向突发性耳聋、急慢性咽炎、鼻炎、鼻窦炎、过敏性鼻炎、肥厚性鼻炎、扁桃体炎、中耳炎等疾病的诊治、流行病学调查。擅长应用高科技综合微创手术系统治疗中、重度鼾症，十年来成功治疗数千例国内外鼾症患者，填补了此项医疗技术在西南地区的空白，处于国内领先地位。承担科研项目</span><span style=\"padding: 0px;font-size: 12px\">6</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">项，发表论文</span><span style=\"padding: 0px;font-size: 12px\">40</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">余篇，获奖</span><span style=\"padding: 0px;font-size: 12px\">6</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">项，参编专著</span><span style=\"padding: 0px;font-size: 12px\">1</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">部。获四川省科学技术进步三等奖、成都市科学技术进</span><span style=\"padding: 0px;font-size: 12px\">&nbsp;</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">步三等奖、</span><span style=\"padding: 0px;font-size: 12px\">“</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">四川省卫生系统先进个人</span><span style=\"padding: 0px;font-size: 12px\">”</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">称号。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;text-indent: 25px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">张浩，男，医学博士，副教授，硕士研究生导师。主要研究方向环境毒理，环境污染与健康，主要涉及生殖遗传毒理，公共场所卫生，环境流行病学等。现任成都市预防医学会常务理事，成都市环境卫生专业委员会主任委员。</span><span style=\"padding: 0px;font-size: 12px\">1983</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年毕业于武汉医学院（现同济医科大学）环境医学专业，</span><span style=\"padding: 0px;font-size: 12px\">2000-2003</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">在四川大学华西公共卫生学院劳动卫生与环境卫生专业攻读博士，</span><span style=\"padding: 0px;font-size: 12px\">2003</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年获四川大学医学博士学位。多年来一直工作在教学、科研第一线，参加了大量的本科学生</span><span style=\"padding: 0px;font-size: 12px\">“</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">环境卫生学</span><span style=\"padding: 0px;font-size: 12px\">”</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">的课堂讲授、指导毕业实习等教学工作，科研上，作为课题主研先后参加了多项国家自然科学基金课题的研究和省部级的科研课题，近</span><span style=\"padding: 0px;font-size: 12px\">5</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年发表科研论文</span><span style=\"padding: 0px;font-size: 12px\">20</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">多篇。现已培养环境医学专业硕士研究生</span><span style=\"padding: 0px;font-size: 12px\">4</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">人。</span><span style=\"padding: 0px;font-size: 12px\"><br style=\"padding: 0px\"/><span style=\"padding: 0px\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">王津涛：女，医学博士，副教授，硕士研究生导师。主要研究方向为环境污染物对人体健康的影响，主要涉及分子遗传毒理学、神经内分泌毒理学、生物标志等研究内容。现任四川大学华西公共卫生学院分子毒理实验室负责人，成都预防医学会第五届环境卫生专业委会委员。作为青年骨干教师，于</span><span style=\"padding: 0px;font-size: 12px\">2009</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年受国家留学基金的资助在美国马萨诸塞州州立大学生物系访问学习</span><span style=\"padding: 0px;font-size: 12px\">18</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">个月。任职以来一直工作在教学、科研第一线，参与了预防医学和卫生检验专业本科学生《环境卫生学》的课堂讲授、毕业实习指导和课间实习的教学，作为研究生指导小组成员培养了</span><span style=\"padding: 0px;font-size: 12px\">4</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">硕士研究生。承担国家自然科学基金课题</span><span style=\"padding: 0px;font-size: 12px\">&nbsp;“</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">应用</span><span style=\"padding: 0px;font-size: 12px\">FRTL-5</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">细胞研究环境甲状腺干扰物作用的分子机制及体外甄别指标</span><span style=\"padding: 0px;font-size: 12px\">”</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">和教育部博士点新教师基金课题</span><span style=\"padding: 0px;font-size: 12px\">“</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">农药类内分泌干扰物影响</span><span style=\"padding: 0px;font-size: 12px\">FRTL-5</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">细胞株对</span><span style=\"padding: 0px;font-size: 12px\">TSH</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">反应性的研究</span><span style=\"padding: 0px;font-size: 12px\">”</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">等，另参研多项国家级和省部级科研课题，发表科研论文</span><span style=\"padding: 0px;font-size: 12px\">20</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">余篇。同时从事保健食品、化妆品、消毒剂、农药等的安全性评价及保健食品功能学评价研究。</span><span style=\"padding: 0px;font-size: 12px\"><br style=\"padding: 0px\"/><span style=\"padding: 0px\">&nbsp;&nbsp;&nbsp;</span></span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">程薇波，女，硕士，副教授，硕士导师，教研室主任，</span><span style=\"padding: 0px;font-size: 12px\">1985</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年毕业于华西医大医学系，现年</span><span style=\"padding: 0px;font-size: 12px\">49</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">岁。专业方向：毒性病理。目前在研项目《汽车尾气致肺脏纤维化的机制研究》系四川省科技攻关课题。近</span><span style=\"padding: 0px;font-size: 12px\">30</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">余篇科研论文国内外杂志发表。主讲课程：《病理学》、《环境病理学》、《动物实验技术与方法》。</span><span style=\"padding: 0px;font-size: 12px\">&nbsp;<br style=\"padding: 0px\"/><span style=\"padding: 0px\">&nbsp;&nbsp;&nbsp;</span></span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">王晔，</span><span style=\"padding: 0px;font-size: 12px\">&nbsp;</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">男，博士，副教授，现年</span><span style=\"padding: 0px;font-size: 12px\">40</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">岁。</span><span style=\"padding: 0px;font-size: 12px\">1999</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年本科毕业于华西医科大学法医学系，获学士学位；</span><span style=\"padding: 0px;font-size: 12px\">2007</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">年获博士学位。研究方向为环境病理学。主讲课程：《病理学》、《环境病理学》、《动物实验技术与方法》、《药物源性损伤的认识与预防》。目前在研课题有：①教育部博士点基金（新教师类）项目：硅酸盐细菌代谢产物降解矽尘研究；②四川省科技支撑计划项目：生物降解技术防治石棉肺研究；③基础研究计划项目：硅酸盐细菌代谢产物防治矽肺研究；另外，承担教改课题：四川大学新世纪教学改革工程（第五期）研究项目－－《病理学》专题讨论式教学研究与实践；此外，参与编写专著</span><span style=\"padding: 0px;font-size: 12px\">4</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">部，在国内外期刊发表论文</span><span style=\"padding: 0px;font-size: 12px\">20</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">余篇。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 18px;text-indent: 27px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">张勤，女，博士，副教授。研究方向：矽肺发病机制及防控策略；重金属污染对人体健康的影响。</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2002</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年四川大学华西公共卫生学院预防医学学士；</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2005</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年本学院劳动卫生与环境卫生学硕士；</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2009</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年中国科学院生态环境研究中心环境化学与生态毒理学国家重点实验室</span></span><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">&nbsp;</span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">博士；</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2015</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年美国哥伦比亚大学医学院放射医学研究中心（</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">Center for Radiological Research, Columbia University Medical Center</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">）</span></span><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">&nbsp;</span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">访问学者。主持完成国家自然科学（青年）基金项目</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项、四川大学青年教师科研基金</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项、环境化学与生态毒理学国家重点实验室开放基金</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项；主研国家自然科学（青年）基金和四川省卫计委项目各</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项；参研十一五和十二五重大专项及卫生部行业专项各</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项。共发表学术论文</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">35</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">篇，其中</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">SCI</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">收录</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">9</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">篇。参编学术专著中英文各</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">部；国家专利</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项。指导校级大学生创新项目</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">3</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项，指导本科毕业论文获校级优秀毕业论文三等奖</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">篇。</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2010</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">、</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2013</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">和</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2014</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年度校青年骨干教师。主要授课课程《环境、职业与健康》、《职业卫生的理论与实践</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">II</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">》、《公共卫生实验技术</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">-5</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">》、《雾霾污染与人体健康》等。</span></span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;text-indent: 21px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">周鼎伦，男，博士，副教授。</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2004</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年毕业于四川大学华西公共卫生学院，获硕士学位，同年留校任教。</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2007</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年获博士学位，专业为环境卫生与职业医学。</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2007-2008</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年到美国</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">Temple University</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">学习，主修社区卫生与健康促进方向。主要从事职业流行病、艾滋病防控、传染病预警等领域的工作。近年来，作为负责人申请留学回国人员科研启动基金、全球基金等项目，总经费</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">20</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">余万元；作为第一主研多项国家级、省部级课题，包括“</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">症状监测预警技术研究</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">”（十一五重大专项）、“</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">基于病原学监测的预警技术研究”（</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">十二五重大专项</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">）、“传染病暴发早期探测与自动预警适宜技术研究”（国家科技支撑计划）、“传染病暴发流行预测预警技术研究”（卫生部行业专项）、“布拖县艾滋病综合防治研究项目评估”（横向）等。近</span><span style=\"padding: 0px\"><span style=\"font-size:16px;padding: 0px\">5</span></span><span style=\"font-size:16px;padding: 0px\">年，发表论文</span><span style=\"padding: 0px\"><span style=\"font-size:16px;padding: 0px\">20</span></span><span style=\"font-size:16px;padding: 0px\">余篇，其中第一作者或通讯作者文章</span><span style=\"padding: 0px\"><span style=\"font-size:16px;padding: 0px\">7</span></span><span style=\"font-size:16px;padding: 0px\">篇。参编论著</span><span style=\"padding: 0px\"><span style=\"font-size:16px;padding: 0px\">3</span></span><span style=\"font-size:16px;padding: 0px\">本（传染病预警理论与实践、艾滋病防治工具书、艾滋病行为监测操作手册）。获攀枝花市科技进步奖（三等奖，</span><span style=\"padding: 0px\"><span style=\"font-size:16px;padding: 0px\">2008</span></span><span style=\"font-size:16px;padding: 0px\">年）</span><span style=\"padding: 0px\"><span style=\"font-size:16px;padding: 0px\">1</span></span><span style=\"font-size:16px;padding: 0px\">项。</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">主要为预防医学专业、卫生检验专业、卫生事业管理与健康保险专业本科生讲授职业卫生与职业医学、职业心理与职业紧张、公共卫生信息管理等课程。</span></span><a style=\"padding: 0px\" name=\"_GoBack\"></a></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 15px;text-indent: 28px\"><strong style=\"padding: 0px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">三、教学情况</span></span></strong></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 24px\"><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">本系开设的主要课程包括为本科生开设的《职业卫生的理论与实践》、《环境、职业与健康》、《职业心理与紧张》、《公共卫生安全评价》、《公共卫生实验技术》、《公共关系学》、《公共卫生信息管理》、《居室与健康》、《环境与健康》、《公共场所监测》、《生态环境与健康》、《病理学</span><span style=\"padding: 0px;font-size: 12px\">-I</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">》、《病理学</span><span style=\"padding: 0px;font-size: 12px\">-II</span><span style=\"padding: 0px;font-size: 12px;font-family: 宋体\">》和《环境病理学》，文化素质公选课《雾霾污染与人体健康》、《室内空气污染与健康》、《环境与生殖发育》、《公共卫生问题专题讲座》和《药源性损伤的认识与预防》，以及研究生课程《动物实验技术与方法》等。</span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 21px;text-indent: 28px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">近</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">3</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年担任副主编论著</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">3</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">部，字数合计</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">14.2</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">万字，参编论著</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">10</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">本，字数合计</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">42</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">万字，参编双语教材</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">1</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">本，字数</span></span><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">2.5</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">万字。</span></span></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 15px;text-indent: 28px\"><strong style=\"padding: 0px\"><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">&nbsp;</span></span></strong></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 15px;text-indent: 28px\"><strong style=\"padding: 0px\"><span style=\"padding: 0px\"><span style=\"font-size:16px;font-family:Times New Roman;padding: 0px\">&nbsp;</span></span></strong></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 15px;text-indent: 28px\"><strong style=\"padding: 0px\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">四、科研情况</span></span></strong></p><p style=\"padding: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-height: 18px;text-indent: 24px\"><span style=\"padding: 0px;font-size: 12px;line-height: 18px;font-family: 宋体\">本系主要研究方向为：</span></p><p style=\"padding: 0px;margin: 0 0 0 19px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal;line-hei