INSERT INTO `mr_article` VALUES ('366', '-1', '135', '四川省医学重点学科：卫生检验', '', '', 'admin', '2017-06-22 11:54:12', '10', '<p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">主要教学成果</span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px\"><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">&nbsp;</span></span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">承担了省教育厅等多项教改项目；获教学成果省级三等奖、校级一等奖、四川大学“优秀教材奖”、“优秀讲义奖”等；担任国家卫计委卫生检验专业规划教材评审委员会主任委员和委员，主编和参编规划教材，近年来主编了</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">20</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">余部教材、专著。</span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px\"><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">&nbsp;</span></span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">科研情况概况</span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px\"><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">&nbsp;</span></span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">学系围绕学科特色，组建了“公众健康与检验技术”、“传染病的预防控制和病原检测”、“慢性病的预防和保健”、“食品安全与环境污染风险监测”四大研究团队，承担完成了多项国家级、省市级科研项目和国际合作项目，包括国家科技重大专项、行业专项、</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">863</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">和</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">973</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项目、国家自然科学基金重点项目和面上项目和欧盟项目，在细菌性和病毒性病原的快速检测、疫苗免疫、消毒、持留菌、肠道菌群分析、食品污染风险检测技术等领域取得了一定研究成果，近</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">10</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">年来，获得科技进步奖</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">4</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项，授权专利</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">4</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">项，发表</span></span><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">SCI</span></span><span style=\"padding: 0px;font-family: 宋体\"><span style=\"font-size:16px;padding: 0px\">收录期刊近百篇。拟与中国疾控中心合作建立“中国西部病毒病研究联合中心”，将充分整合四川大学和中国疾病预防控制中心病毒病所，特别是国家流感中心的优势，进行病毒病原学、流行病学、遗传学、免疫学、细胞微生物学、致病机理及相应的诊断、疫苗和治疗等病毒生物技术研究。</span></span></p><p style=\"padding: 0px;margin-top: 0px;margin-bottom: 0px;color: rgb(51, 51, 51);font-family: ����;font-size: 12px;white-space: normal\"><span style=\"padding: 0px\"><span style=\"font-family:Calibri;font-size:16px;padding: 0px\">&nbsp;</span></span></p><p><br/></p>', '1', '', '', '0', null, null), ('367', '-1', '121', 'fdsafdsafda', '', '', 'admin', '2017-06-22 13:18:08', '0', '', '1', null, 'http://172.16.5.196:8080/upload/image/20170622/1498108684125090302.png', '0', null, null), ('369', '-1', '146', '招聘启事', '', '', 'admin', '2017-06-22 19:19:29', '1', '<p>招聘启事</p>', '1', null, '', '0', null, null), ('370', '57', '148', '资料系在', '', '', 'admin', '2017-06-22 19:30:04', '5', '<p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"http://172.16.5.196:8080/public/ueditor/dialogs/attachment/fileTypeImages/icon_rar.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/file/20170622/1498130998585054268.zip\" title=\"20170619周刊.zip\">20170619周刊.zip</a></p><p><br/></p>', '1', '', '', '0', null, null), ('371', '57', '147', '部门职责4314314', '', '', 'admin', '2017-06-22 19:58:08', '12', '<p>部门职责4314314</p>', '1', null, '', '0', null, '2017-06-23 14:53:52'), ('372', '57', '149', '地方撒范德萨范德萨范德萨', '', '', '雨林博客', '2017-06-23 16:18:42', '1', '<p>范德萨范德萨范德萨</p>', '1', '', '', '0', null, null);
