INSERT INTO `mr_content` VALUES ('<p>1都是发放 地方撒旦是否 第三方达撒范德萨1范德萨范德萨fdsa&nbsp;</p><p>fdsa 范德萨</p><p><br/></p><p>fdsa fdsa</p><p>fdsa fdsa fdsa fdsa</p><p>&nbsp;范德萨范德萨范德萨</p>', '1', '2017-06-13 17:59:24', 'channel'), ('<p>fsdafds&nbsp;</p><p>fds</p><p>a&nbsp;</p><p>fds</p><p>a&nbsp;</p><p>fds</p><p>a fdsa&nbsp;<img src=\"http://img.baidu.com/hi/jx2/j_0013.gif\"/></p>', '2', '2017-06-13 17:52:46', 'channel'), ('<h5 style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); line-height: 46px; height: 46px; font-size: 16px; font-weight: 400; overflow: hidden; text-overflow: ellipsis; max-width: 100%; font-family: &quot;Microsoft YaHei&quot;;\">四川大学华西公共卫生院</h5><p><br/></p><article style=\"padding: 0px; margin: 0px; color: rgb(153, 153, 153); font-size: 14px; line-height: 25px; font-family: \" microsoft=\"\" white-space:=\"\"><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\">华西公共卫生学院是中国最著名的公共卫生学院之一，历史可追溯到1914年在“华西协和大学医学院”建立的公共卫生学课程组，1936年发展为公共卫生学系，1951年更名为“国立华西大学公共卫生学系”，后于1986年成立“华西医科大学公共卫生学院”。2000年，原华西医科大学与四川大学合并，学院遂为“四川大学华西公共卫生学院”。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 经过百年的建设，目前学院由学院本部、四川大学华西第四医院（职业病防治医院）和四川大学华西卫生管理干部培训中心组成，集教学、科研、医疗、预防、保健、干部培训和高科技开发为一体。学院有公共卫生与预防医学博士后流动站，7个博士点，12个硕士点。博士点和硕士点覆盖预防医学的各个学科。7个博士点分别是流行病与卫生统计学、劳动卫生与环境卫生学、营养与食品卫生学、健康与社会行为学、社会医学与卫生事业管理学、卫生检验与检疫和儿少卫生与妇幼保健学。营养与食品卫生学为国家重点学科，社会医学与卫生事业管理、劳动卫生与环境卫生学、姑息医学、卫生检验学为四川省重点学科。7个博士点同时也是硕士点，另有卫生毒理学、老年保健与姑息医学、卫生政策与管理、职业卫生与职业医学、公共卫生、共5个硕士点。学院现开设有预防医学、卫生检验与检疫、食品卫生与营养学三个本科专业。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 学院现有教职工 130余人，其中高级职称 60 人。在校本科生948人，博士生47人，硕士生501人。学院有一批献身公共卫生事业的知名教授。四川省学术和技术带头人 4人，四川省卫生计生委学术和技术带头人8人。近年从各种渠道引进人才，包括外专千人1名、全职外籍教授2名、长江特聘教授和杰青各2名、中组部“青年千人”4名，国家优秀青年科学基金获得者1人，教育部“新世纪优秀人才”2名，及12名海外或海外经历博士。学院专任教师80余人，博士生导师27人、硕士生导师46人，专职科研人员12人；新聘50余名公共卫生机构高级职称人员为兼职教师，建立了一支年龄结构合理、教学科研能力卓越的师资队伍。已故陈志潜教授，是享誉世界的公共卫生学专家、初级卫生保健的先驱、农村三级卫生保健网的创建者、中国现代健康教育的奠基人，被誉为“中国公共卫生之父”。陈志潜教授献身于医学事业，治学严谨、崇尚科学、勇于创新，为人类健康和我国公共卫生事业做出了杰出贡献。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 学院始终坚持以教学为中心，以育人为根本的原则；以转变教育观念为关键，以教学改革为核心，充分发挥传统学科与新兴学科的优势，按高起点、高目标要求，在专业设置、课程体系、教学内容和实践性教学环节等方面，真正从学生获得知识和提高素质与能力出发，加强基础训练，重视创新能力、创新思维、综合素质与实践技能的培养，初步建成了面向未来、面向世界、面向先进的科学技术，德智体全面发展的高素质创新人才培养体系，力求将我院建成具有一定特色、优势突出、国内先进、国际上具有一定影响的公共卫生学科高层次人才培养基地。 学院历来重视教材建设，我院教师主编的卫生部规划教材《卫生统计学》已出 4 版，第 1 版被评为卫生部优秀教材，第 3 版获得卫生部医药卫生杰出科技进步三等奖。仅 2002 年以来，学院教师主编和参编各类教材 57本。其中，高等教育“十五”国家规划教材 10 本，主编 3本、副主编1本；高等教育“十一五”国家规划教材主编4本；卫生部规划教材20 部，主编 10 本。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 我院是国内卫生检验专业的发源地，该专业也是我院的优势专业，至今学科地位在全国仍位居第一。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 近二十年来，学院共承担完成各类科研课题 600 余项，有80余项科研成果荣获各级奖励。其中国家级和省部级奖励30余项。学院 30 余名教师担任全国性学术团体的理事或二级学会的主任委员， 40 余名教师担任省级学术团体主任、副主任及理事。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 学院主办的《现代预防医学》杂志，现为中华预防医学卫生学类核心期刊、中国科技论文统计源期刊，被评为“中华预防医学会系列杂志优秀期刊”，发行国内外。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 35px;\"> 为着我国公共卫生事业和教育事业的崇高目标，华西公共卫生学院全体教职工正以“自强不息，直道而行，千仞可及”共勉，创造更大的辉煌！　</p></article><p><br/></p><p><br/></p>', '3', '2017-06-13 18:21:39', 'channel'), ('<p><img src=\"http://172.16.5.196:8080/upload/image/20170622/1498100782815076820.jpg\" title=\"1498100782815076820.jpg\" alt=\"0504-11111.jpg\"/></p><p><img src=\"http://172.16.5.196:8080/upload/image/20170622/1498100823865034255.jpg\" style=\"\" title=\"1498100823865034255.jpg\"/></p><p><img src=\"http://172.16.5.196:8080/upload/image/20170622/1498100824244077517.jpg\" style=\"\" title=\"1498100824244077517.jpg\"/></p><p><br/></p>', '4', '2017-06-22 11:09:46', 'channel'), ('<p style=\"text-align: center\"><img src=\"http://172.16.5.196:8080/upload/image/20170622/1498101090429022318.jpg\" title=\"1498101090429022318.jpg\" alt=\"组织.jpg\"/></p><p><br/></p>', '5', '2017-06-22 11:11:40', 'channel'), ('<p><span style=\"font-family: arial, \" microsoft=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" background-color:=\"\">学术和中心</span></p>', '6', '2017-06-22 11:59:50', 'channel'), ('', '7', '2017-06-13 18:20:58', 'channel'), ('', '8', '2017-06-22 11:13:41', 'channel'), ('', '9', '2017-06-22 11:14:16', 'channel'), ('', '10', '2017-06-19 12:59:58', 'channel'), ('', '11', '2017-06-19 13:00:07', 'channel'), ('', '12', '2017-06-19 13:00:15', 'channel'), ('', '13', '2017-06-19 17:05:11', 'channel'), ('', '14', '2017-06-19 17:08:29', 'channel'), ('<p><img src=\"http://172.16.5.196:8080/upload/image/20170619/1497862757346018333.jpeg\" title=\"1497862757346018333.jpeg\" alt=\"timg.jpeg\"/></p>', '15', '2017-06-19 16:59:21', 'channel'), ('', '16', '2017-06-19 16:46:12', 'channel'), ('', '17', '2017-06-19 16:47:12', 'channel'), ('', '18', '2017-06-19 16:47:38', 'channel'), ('', '19', '2017-06-19 16:47:58', 'channel'), ('', '20', '2017-06-19 13:08:18', 'channel'), ('', '21', '2017-06-19 16:49:09', 'channel'), ('', '22', '2017-06-22 11:14:29', 'channel'), ('', '23', '2017-06-22 11:13:21', 'channel'), ('', '24', '2017-06-19 16:38:35', 'channel'), ('', '25', '2017-06-22 11:14:59', 'channel'), ('', '26', '2017-06-22 11:52:15', 'channel'), ('', '27', '2017-06-19 17:24:25', 'channel'), ('', '28', '2017-06-19 17:24:48', 'channel'), ('', '29', '2017-06-19 17:24:59', 'channel'), ('', '30', '2017-06-19 17:31:55', 'channel'), ('', '31', '2017-06-22 10:07:15', 'channel'), ('', '32', '2017-06-22 11:24:46', 'channel'), ('', '33', '2017-06-22 10:30:48', 'channel'), ('', '34', '2017-06-22 11:33:19', 'channel'), ('', '35', '2017-06-22 13:17:15', 'channel'), ('', '36', '2017-06-22 19:29:10', 'channel'), ('', '37', '2017-06-22 19:29:23', 'channel'), ('', '38', '2017-06-23 17:35:02', 'channel');
